"virus_minor_desc_pua_misc" : "Потенциально нежелательные приложения (PUA) могут:
 • входить в состав пакета установки (установка других приложений (в комплекте программного обеспечения) без вашего согласия);
 • распространять рекламу (отображение чрезмерного количества рекламных объявлений, прерывая работу или раздражая пользователей);
 • собирать информацию (без согласия пользователей);
 • выполнять другие нежелательные действия."

"dialog_content_donation" : "Пожертвования пойдут на:
 - улучшение среды разработки;
 - повышение мотивации разработчиков.

 Все пожертвования будут:
 - предоставляться на безвозмездной основе, то есть даритель не может требовать от разработчика выполнения каких-либо действий в интересах дарителя;
 - принадлежать разработчику;
 - подразумевать согласие дарителя со всеми вышеуказанными пунктами.

 Alipay:
 matthewlee0725@gmail.com"
